import styled from 'styled-components'

export const LongButton = styled.button`
    text-decoration: none;
    border: none;
    width:80%;
    font-size: 15px;
    height:35px;
    color:white;
    box-sizing:border-box;
    border-radius:2px;
    padding: 0.5em 0;
    margin:0.5em 0;
    background-color: #6C7B8A
`
